/*import React from "react";

function ContactCard(props) {
    return (
        <div className="contacts">
            <div className="contact-card">
                <img src={props.imgUrl} alt="alternate"/>
                <h3>{props.name}</h3>
                <p>{props.phone}</p>
                <p>{props.email}</p>
            </div>
        </div>
    )
}

export default ContactCard;*/
